// src/App.js

import React from 'react';
import BusinessCard from './BusinessCard';
import styled from 'styled-components';

const AppContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background: #121212;
`;

const App = () => {
  return (
    <AppContainer>
      <BusinessCard />
    </AppContainer>
  );
};

export default App;
